import React from 'react';
import { IoMdHeart } from "react-icons/io";

const Products = (props) => {
    const { data } = props;
    let products = [];
    if (data) {
        if (data.productPromo) {
            if (data.productPromo.length > 0) {
                data.productPromo.map((data, index) => {
                    products.push(
                        <div className="container" key={index}>
                            <div className="product-list">
                                <img src={data.imageUrl} alt="category" />
                            </div>
                            <IoMdHeart className="product-list__loved" />
                        </div>,
                    );
                    return data;
                })
            }
        }
    }
    return (
        <div className="margin-top-4 products">{products}</div>
    )
}
export default Products;
